import axios from "axios";

export const useGetNumberOfServices = ({ part, setData, setLoading }) => {
  let config = {
    method: "get",
    url: `http://localhost:8080/part?id=${part}`,
    headers: {},
  };
  axios(config)
    .then(function (response) {
      setData(response.data);
      setLoading(false);
    })
    .catch(function (error) {
      console.log(error);
    });
};
